import React, { Component } from 'react';
import './App.css';


class App extends Component {

  constructor() {
    super();
    this.state = {
      serverURL: 'https://frozen-thicket-30265.herokuapp.com/downloadmp3?url=',
      watchLink: 'https://www.youtube.com/watch?v=wzU_ykxUs2s'
    }
  }

  render() {
    return (
      <div className="App">
        <audio src={this.state.serverURL + this.state.watchLink} controls autoPlay />
      </div>
    );
  }
}

export default App;
